Classes in Kiwi can have a primary constructor and one or more secondary constructors using following syntax. class Person(firstName: String) { ... } The primary constructor cannot contain any code. Initialization code can be placed in initializer blocks, which are prefixed with the init keyword. During the initialization of an instance, the initializer blocks are executed in the same order as they appear in the class body, interleaved with the property initializers: class InitOrderDemo(name: String) { firstProperty: auto = "First property: $name".also(::print) init { println("First initializer block that prints ${name}") } secondProperty: auto = "Second property: ${name.length}".also(::print) init { println("Second initializer block that prints ${name.length}") }
} Primary constructor parameters can be used in the initializer blocks. They can also be used in property initializers declared in the class body: class Customer(name: String) { customerKey: auto = name.toUpperCase()
} Primary constructors also can store parameters as properties using any visibility modifier (by default, they are public): class Person( public firstName: String, public lastName: String, public age: Int, # trailing comma is allowed
) { ... } You can add syntactic sugar to constructor parameters. class Person( public (firstName, lastName): String by components, public age: Int by components = -1,
) { ... } Learn more about parameter delegation . As with functions, you can add a default parameter values. class Person( public firstName: String = "John", public lastName: String = "Doe", public age: Int = 0,
) { ... } Learn more about visibility modifiers .

