The class can also declare secondary constructors, which are prefixed with the constructor keyword: class Person { constructor(parent: Person) { parent.children.add(this) }
} If the class has a primary constructor, each secondary constructor needs to delegate to the primary constructor, either directly or indirectly through another secondary constructor(s). Delegation to another constructor of the same class is done using the this keyword: class Person(val name: String) { constructor(name: String, parent: Person) : this(name) # delegate to primary constructor { parent.children.add(this) }
} Or you can call primary constructor directly: class Person(val name: String) { constructor(name: String, parent: Person) { parent.children.add(this) this(name) # call primary constructor }
} Note that code in initializer blocks will be executed after the primary constructor and before secondary constructors: class Constructors { init { println("Init block") } constructor(i: Int) { println("Constructor") }
} If a non-abstract class does not declare any constructors, it will have default constructor with no arguments. If you don't want your class to have a public constructor, declare an empty primary constructor with private modifier: class DontCreateMe private { ... }

